import dados from '../dados/dadosClientes.json'

function lista() {
   return (
      <div>{dados.map((item) => (console.log(item.numeroCliente,),<p>{item.nomeCliente}</p>,<p>{item.usinas[0].percentualDeParticipacao}</p>))}</div>
   )
}
export default lista;
